import React from 'react'
import './Chart.css'
import ChartBar from './ChartBar'

const Chart = () => {
  return (
    <div className='chart'>
      {props.dataPoints.map ((dataPoint) => 
      {
        <ChartBar
        key={dataPoint.label}
        value={dataPoint.value}
        maxValue={null}
        lable={dataPoint.label}/> 
        

      }) }
    </div>
  )
}

export default Chart
